import "./Contact.css";

function Contact() {
    return (
        <div className="Contact">
            <h1>Contact Me</h1>
            <div className="ContactButtonContainer">
                <a className="ContactButton"><i className={"fa-solid fa-envelope"} onClick={(e) => {
                    window.location.href='mailto:aadi.kulsh@gmail.com';
                    }}></i> Email</a>
                <a className="ContactButton"><i className={"fa-brands fa-linkedin"} onClick={(e) => window.location.href='https://www.linkedin.com/in/aadi-kulshrestha/'}></i> LinkedIn</a>
                <a className="ContactButton"><i className={"fa-brands fa-github"} onClick={(e) => {
                    console.log("CLICK")
                    window.location.href='https://github.com/MankyDanky'
                    }}></i> GitHub</a>
            </div>
        </div>
    );
}

export default Contact
